import React, { Component } from "react";
import Home from "./HomeComponent";
import Inform from "./InformComponent";
import Connect from "./ConnectComponent";
import Reduce from "./ReduceComponent";
import Tech from "./TechComponent";
import Rescue from "./RescueComponent";
import Collab from "./CollabComponent";
import Header from "./HeaderComponent";
import Footer from "./FooterComponent";
import { Switch, Route, Redirect } from "react-router-dom";

const Main = () => {
  return (
    <div>
      <Header />
      <Switch>
        <Route path="/home" component={Home} />
        <Inform path="/inform" component={Inform} />
        <Connect path="/connect" component={Connect} />
        <Reduce path="/reduce" component={Reduce} />
        <Tech path="/tech" component={Tech} />
        <Rescue path="/rescue" component={Rescue} />
        <Collab path="/collab" component={Collab} />
      </Switch>
      <Footer />
    </div>
  );
};

export default Main;
